import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.css'
import { Route, NavLink, Switch, Redirect, withRouter} from 'react-router-dom'
import GroupList from './GroupList'
import FriendList from './FriendList'

class List extends Component {
  tofriend=()=>{
    this.props.history.push('/list/friendlist');
  }
  togroup=()=>{
    this.props.history.push('/list/grouplist');
  }

  render() {
    return (
      <div>
        {/* 注册路由 */}
        <div onClick={tofriend}>tofriend</div>
        <div onClick={togroup}>togroup</div>
        <Switch>
          <Route path='/list/friendlist' component={FriendList}></Route>
          <Route path='/list/grouplist' component={GroupList}></Route>
        </Switch>
      </div>
    )
  }
}

export default withRouter(List);
